import React from 'react';
import Card from '@material-ui/core/Card';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Simeon from '../site-images/simeon.jpg';

const useStyles = makeStyles((theme) => ({
    card: {
        maxWidth: 450,
        margin: 'auto',
        padding: theme.spacing(2),
    },
}));

export default function CardExample() {
    const classes = useStyles();

    return (
        <Card 
            className={classes.card} 
        >
            <CardMedia 
                component='img'
                src={Simeon}
                alt='Simeon Ikudabo' 
            />
            <CardContent>
                <Typography 
                    variant='h6'
                    component='h6' 
                >
                    Simeon Ikudabo
                </Typography>
                <Typography 
                    variant='body1'
                    component='p' 
                >
                    Simeon Ikudabo is a software engineer from Marion, Indiana who spent 
                    his time doing some interesting things in the past. Simeon is someone 
                    who enjoys learning and having a positive direction. 
                </Typography>
            </CardContent>
            <CardActions>
                <Button>
                    Learn More
                </Button>
                <Button>
                    Discover 
                </Button>
            </CardActions>
        </Card>
    );
}
